import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import MocionesList from './components/MocionesList';
import CreateMocion from './components/CreateMocion';
import EditMocion from './components/EditMocion';

const App = () => {
    return (
        <Router>
            <div>
                <nav>
                    <Link to="/">Lista de Mociones</Link> | <Link to="/add">Agregar Moci√≥n</Link>
                </nav>
                <Routes>
                    <Route path="/" element={<MocionesList />} />
                    <Route path="/add" element={<CreateMocion />} />
                    <Route path="/edit/:id" element={<EditMocion />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
